This is was one of those things I always saw creators on the internet share but that was it, never really visualised myself having one. Yes I know I hit 100k but the tangibility of this package arriving home was a completely different feeling. It felt like a cute gift, that I actually earned. 

People say not to get caught up in numbers but I also remember that number being 1 & now to see your name on something you’ve only ever seen on the internet, felt like I must’ve done something right▶️✨🧿🤍

